*     8(1): pfedb_edbmm62 muon
*     8(2): pfedb_edbmm31 z
      call smffv(lextrn,lextrn,lepinv,exedb_edbmm62n,exedb_edbmm33n,
     &           amlp(2),amlp(2),czll(1,2),cfedb_edbmm62n,
     &           cfedb_edbmm33n,ptedb_edbmm62n,ptedb_edbmm33n,
     &           eqedb_edbmm31c,lt8,av8)

*     9(0): pfedb_edbmm4 electron
*     9(1): pfedb_edbmm17 electron
*     9(2): pfedb_edbmm20 z
      call smffv(lextrn,lextrn,lepinv,exedb_edbmm17m,exedb_edbmm4m,
     &           amlp(1),amlp(1),czll(1,1),cfedb_edbmm17m,cfedb_edbmm4m,
     &           ptedb_edbmm17m,ptedb_edbmm4m,eqedb_edbmm20c,lt9,av9)

      call smconf(lt6,lt7,1,2,exedb_edbmm28s,av6,av7,lt10,av10)
      call smconv(lt8,lt10,3,2,evedb_edbmm31c,av8,av10,lt11,av11)
      call smconv(lt9,lt11,3,5,evedb_edbmm20c,av9,av11,lt,av)

      sym = - 1.0d0
      aprop         = sym/aprop

      indexg(1) = 4
      indexg(2) = 2
      indexg(3) = 6
      indexg(4) = 5
      indexg(5) = 1
      indexg(6) = 3

      call aedb_edbmmmpord(lt, av, indexg, agcwrk)

      ancp(jgraph) = 0.0d0
*     nbase = 1
      cwgt = 1.d0
      do 500 ih = 0 , ledb_edbmmag-1
         atmp    = cwgt*agcwrk(ih)*aprop
         agc(ih) = agc(ih) + atmp
         ancp(jgraph) = ancp(jgraph) + atmp*conjg(atmp)
  500 continue

      return
      end
